css:
.info-messages,
.error-messages {
  margin: 0;
  padding: 0;
  list-style: none;
}
.error-messages {
  color: #cc0000;
}
ul.background-message {
  font-size: 33px;
  margin: 0;
  padding: 0;
}
ul.background-message li {
  margin: 0;
  padding: 0;
  list-style: none;
}
ul.background-message.centered {
  display: -webkit-flex;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  -webkit-align-items: center;
  text-align: center;
}
ul.background-message.centered li {
  width: 100%;
}
